import React from 'react';
import PropTypes from "prop-types";

function Myfrind({name,rating}){
  return (
    <div>
      <h2>i like {name}</h2>
      <h4>{rating}/5.0</h4>
    </div>
  )
}

Myfrind.prototype = {
  name : PropTypes.string.isRequired,
  rating : PropTypes.number.isRequired
}

const Frind = [
  {
    id : 1,
    name :"hanry",
    rating : 4.9
  },
  {
    id : 2,
    name :"honey",
    rating : 4.5
  },
  {
    id : 3,
    name : "me?",
    rating : 5.1
  }
];

// let res = Myfrind.map(function(fri){
//   return fri + " love";
// })
// console.log(res);


function App() {
  return (
    <div className="App">
      <h1>hi!</h1>      
      {Frind.map(mf=>(
        <Myfrind 
        key = {mf.id} 
        name = {mf.name}
        rating = {mf.rating}/> 
      ))}
    </div>
  );
}

export default App;
